import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Link } from 'react-router-dom';

const Navb = () => {
  return (
    <>
      <Navbar variant="light" data-bs-theme="light">
        <Container>
          <Navbar.Brand><h1>Zen</h1></Navbar.Brand>
          <Nav className="me-auto">
            <ul>
            <Nav.Link as={Link} to="/" className="text-white bg-black hover:text-white rounded-md px-3 py-2"><li>Home</li></Nav.Link>
            <Nav.Link as={Link} to="/tasks"><li>Tasks</li></Nav.Link>
            <Nav.Link href="#pricing"><li>Add Tasks</li></Nav.Link>
            <Nav.Link href="#pricing"><li>Profile</li></Nav.Link>
            <Nav.Link href="#pricing"><li>Logout</li></Nav.Link>
            </ul>
          </Nav>
        </Container>
      </Navbar>
    </>
  )
}

export default Navb
